            <thead>
            <tr>
                <th>IdAc</th>
                <th>TitreAc</th>
                <th>Description</th>
                <th>Image</th>
                <th>DateAjout</th>
                <th>actions</th>
            </tr>
            </thead>
            <tbody>
            {% for actualite in actualites %}
                <tr>
                    <td>{{ actualite.idAc }}</td>
                    <td>{{ actualite.titreAc }}</td>
                    <td>{{ actualite.description }}</td>
                    <td>{{ actualite.image }}</td>
                    <td>{{ actualite.dateAjout ? actualite.dateAjout|date('Y-m-d H:i:s') : '' }}</td>
                    <td>
                        <a href=\"{{ path('actualite_show', {'idAc': actualite.idAc}) }}\">show</a>
